import React, { Component } from "react";
import Carousel from "react-bootstrap/Carousel";

class DashPop extends Component {
  state = {};
  render() {
    return (
      <div className="dashOutlineWrapper">
        <div className="dashOutlineHeader">Popular recipes</div>
        <Carousel>
          <Carousel.Item>
            <Carousel.Caption>
              <div style={{ width: 200, height: 200 }}>This is content</div>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <Carousel.Caption>
              <div>Second item</div>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </div>
    );
  }
}

export default DashPop;
